import{_ as a,o as t,c as l,R as e}from"./chunks/framework.E9w9IFh5.js";const B=JSON.parse('{"title":"V2.9.0更新详情","description":"","frontmatter":{"title":"V2.9.0更新详情","date":"2020-07-01T14:30:10.000Z"},"headers":[],"relativePath":"doc/wpdoc/V2.9.0更新详情.md","filePath":"doc/wpdoc/V2.9.0更新详情.md"}'),i={name:"doc/wpdoc/V2.9.0更新详情.md"},p=e('<h3 id="登录改造" tabindex="-1">登录改造 <a class="header-anchor" href="#登录改造" aria-label="Permalink to &quot;登录改造&quot;">​</a></h3><h4 id="改造目的" tabindex="-1">改造目的 <a class="header-anchor" href="#改造目的" aria-label="Permalink to &quot;改造目的&quot;">​</a></h4><p>为了解决项目上环境的资源和服务统一部署及解决项目上开发者在各个环境的开发控制能力。</p><h4 id="登录界面" tabindex="-1">登录界面 <a class="header-anchor" href="#登录界面" aria-label="Permalink to &quot;登录界面&quot;">​</a></h4><p>如下图：</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E4%B8%AD%E5%BF%83%E7%99%BB%E5%BD%95.png" alt="中心登录"></p><ul><li>1).登录方式选择：“中心登录”、“非中心登录”，“非中心登录”即现在一直使用的登录方式，跟过去登录操作一致。“中心登录”则为改造后的登录方式。</li><li>2).账号输入：开发者账号。</li><li>3).密码：开发者登录密码。</li><li>4).控制台服务部署环境：开发者控制台服务部署的环境。</li></ul><h4 id="租户环境选择页面" tabindex="-1">租户环境选择页面 <a class="header-anchor" href="#租户环境选择页面" aria-label="Permalink to &quot;租户环境选择页面&quot;">​</a></h4><p>从登录界面，点击登录按钮后，进入租户与环境选择页面，如下图：</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E7%A7%9F%E6%88%B7%E7%8E%AF%E5%A2%83%E9%80%89%E6%8B%A9.png" alt="租户环境选择"></p><ul><li>1).所拥有的的项目：展示当前开发者有权限配置的项目列表。</li><li>2).选择项目环境：选择项目后，此处展示当前开发者所选项目有权限配置的项目环境</li></ul><p>选择完项目和项目环境之后，点击“进入开发”，则可进入所选项目及其对应环境的配置界面（配置界面与之前的一致）。</p><h3 id="控件-事件复制粘贴" tabindex="-1">控件&amp;事件复制粘贴 <a class="header-anchor" href="#控件-事件复制粘贴" aria-label="Permalink to &quot;控件&amp;事件复制粘贴&quot;">​</a></h3><h4 id="一、控件的复制与粘贴" tabindex="-1">一、控件的复制与粘贴 <a class="header-anchor" href="#一、控件的复制与粘贴" aria-label="Permalink to &quot;一、控件的复制与粘贴&quot;">​</a></h4><p>选中控件后，控件的右上角显示控件操作按钮，依次为“复制到粘贴板”、“复制”、“删除”，如下图所示：</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E6%8E%A7%E4%BB%B6%E5%A4%8D%E5%88%B6%E7%B2%98%E8%B4%B4.png" alt="控件赋值粘贴"></p><h5 id="功能说明" tabindex="-1">功能说明 <a class="header-anchor" href="#功能说明" aria-label="Permalink to &quot;功能说明&quot;">​</a></h5><ul><li>1.“复制到粘贴板”：点击该功能按钮，当前控件的数据会复制到IDE的控件粘贴板（粘贴板上只会保留最新的控件），通过点击“粘贴控件”功能按钮可以将粘贴板上的控件粘贴到当前UI表单。</li><li>2.“复制”：点击该功能按钮，会在当前选中控件后面增加一个当前控件的副本控件。</li><li>3.“删除”：点击该功能按钮，弹出删除控件确认弹窗，确认后，将当前控件从UI表单中删除</li><li>4.“粘贴控件”：如果IDE的控件粘贴板上有控件，点击该功能按钮，会将粘贴板上的控件添加到当前UI表单，粘贴的控件的位置：如果当前表单中有选中控件，则粘贴到选中控件的后面，如果没有选中控件，则粘贴到表单的末尾。此功能主要用于跨表单复制控件。</li></ul><h5 id="备注" tabindex="-1">备注 <a class="header-anchor" href="#备注" aria-label="Permalink to &quot;备注&quot;">​</a></h5><p>复制粘贴功能会将控件的所有数据复制(控件code会重新取值，title则在原数据上添加“copy-”前缀)，包括事件的绑定关系（事件code），但绑定的事件不会复制粘贴。</p><h4 id="二、事件的复制与粘贴" tabindex="-1">二、事件的复制与粘贴 <a class="header-anchor" href="#二、事件的复制与粘贴" aria-label="Permalink to &quot;二、事件的复制与粘贴&quot;">​</a></h4><p>鼠标经过事件时，事件右侧显示事件操作按钮，依次为“复制到粘贴板”、“复制”、“删除”，如下图所示：</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E4%BA%8B%E4%BB%B6%E5%A4%8D%E5%88%B6%E7%B2%98%E8%B4%B4.png" alt="事件复制粘贴"></p><h5 id="功能说明-1" tabindex="-1">功能说明 <a class="header-anchor" href="#功能说明-1" aria-label="Permalink to &quot;功能说明&quot;">​</a></h5><ul><li>1.“复制到粘贴板”：点击该功能按钮，当前事件的数据会复制到IDE的事件粘贴板（粘贴板上只会保留最新的事件），通过点击“粘贴事件”功能按钮可以将粘贴板上的事件粘贴到当前UI表单。</li><li>2.“复制”：点击该功能按钮，会在当前事件后面增加一个当前事件的副本事件。</li><li>3.“删除”：点击该功能按钮，弹出删除事件确认弹窗，确认后，将当前事件从UI表单中删除</li><li>4.“粘贴事件”：如果IDE的事件粘贴板上有事件，点击该功能按钮，会将粘贴板上的事件添加到当前UI表单“更多事件”的末尾，此功能主要用于跨表单复制事件。</li></ul><h5 id="备注-1" tabindex="-1">备注 <a class="header-anchor" href="#备注-1" aria-label="Permalink to &quot;备注&quot;">​</a></h5><p>复制粘贴功能会将事件的所有数据复制(事件code会重新取值，事件名称则在原数据上添加“copy-”前缀)，包括事件的输入输出字段的绑定关系（绑定的控件code），但绑定的控件不会复制粘贴。</p><h3 id="ui配置优化说明" tabindex="-1">UI配置优化说明 <a class="header-anchor" href="#ui配置优化说明" aria-label="Permalink to &quot;UI配置优化说明&quot;">​</a></h3><h4 id="_1-控件点击添加按钮直接添加到ui表单" tabindex="-1">1.控件点击添加按钮直接添加到UI表单 <a class="header-anchor" href="#_1-控件点击添加按钮直接添加到ui表单" aria-label="Permalink to &quot;1.控件点击添加按钮直接添加到UI表单&quot;">​</a></h4><p>如下图所示：鼠标经过控件，在控件右侧会出现“添加”按钮，点击“添加”按钮，控件将添加到UI表单上，控件添加的位置类似“粘贴控件”功能，如果当前表单中有选中控件，则添加到选中控件的后面，如果没有选中控件，则添加到表单的末尾。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E6%B7%BB%E5%8A%A0%E6%8E%A7%E4%BB%B6.png" alt="添加控件"></p><h4 id="_2-控件属性鼠标经过显示属性英文名" tabindex="-1">2.控件属性鼠标经过显示属性英文名 <a class="header-anchor" href="#_2-控件属性鼠标经过显示属性英文名" aria-label="Permalink to &quot;2.控件属性鼠标经过显示属性英文名&quot;">​</a></h4><p>如下图所示：鼠标滑动到“控件名称”，在旁边会显示属性英文名“name”.</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%B1%9E%E6%80%A7%E8%8B%B1%E6%96%87%E5%90%8D.png" alt="属性英文名"></p><h4 id="_3-部分属性添加帮助信息" tabindex="-1">3.部分属性添加帮助信息 <a class="header-anchor" href="#_3-部分属性添加帮助信息" aria-label="Permalink to &quot;3.部分属性添加帮助信息&quot;">​</a></h4><p>某些属性从字面上看不太好理解属性的用处，所以再属性后面添加了一个“？”图标，鼠标经过，会显示属性的帮助信息。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%B8%AE%E5%8A%A9%E4%BF%A1%E6%81%AF.png" alt="帮助信息"></p><h4 id="_4-事件关联优化" tabindex="-1">4.事件关联优化 <a class="header-anchor" href="#_4-事件关联优化" aria-label="Permalink to &quot;4.事件关联优化&quot;">​</a></h4><p>此优化的目的是为了避免当表单中有很多事件的时候，要关联及编辑事件，不好寻找目标事件。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E4%BA%8B%E4%BB%B6%E5%85%B3%E8%81%94.png" alt="事件关联"></p><p>如上图：</p><ul><li>1).如果事件未关联，可以点击右侧添加按钮直接向“更多事件”中添加事件，事件添加后，自动关联为添加的事件。</li><li>2).如果事件已关联，可以点击右侧编辑按钮直接编辑当前关联的事件。</li></ul><h4 id="_5-选项值配置优化" tabindex="-1">5.选项值配置优化 <a class="header-anchor" href="#_5-选项值配置优化" aria-label="Permalink to &quot;5.选项值配置优化&quot;">​</a></h4><p>之前，选项值只能进入选项值配置弹窗才能查看及编辑，当前版本对齐优化，如下图：</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E9%80%89%E9%A1%B9%E5%80%BC.png" alt="选项值"></p><p>可以直接在属性设置面板上查看已编辑的数据，添加删除选项，编辑key/text，设置或取消默认选中项，以及排序，如果要编辑选项的其他属性，则可点击“编辑全部”按钮进入弹窗编辑，设置选项的其他属性。</p><h4 id="_6-添加常用控件" tabindex="-1">6.添加常用控件 <a class="header-anchor" href="#_6-添加常用控件" aria-label="Permalink to &quot;6.添加常用控件&quot;">​</a></h4><p>添加常用控件分类，里面包含使用频率较高的控件（控件按英文首字母排序），并且会记录用户收起展开常用控件的习惯，如：当收起“常用控件”分类时，在下一次打开表单编辑时，“常用控件”默认收起。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%B8%B8%E7%94%A8%E6%8E%A7%E4%BB%B6.png" alt="常用控件"></p><h4 id="_7-将常用属性放置在属性配置面板上方" tabindex="-1">7.将常用属性放置在属性配置面板上方 <a class="header-anchor" href="#_7-将常用属性放置在属性配置面板上方" aria-label="Permalink to &quot;7.将常用属性放置在属性配置面板上方&quot;">​</a></h4><p>常用属性放置在属性配置面板上方，剩下的属性为“其他属性”</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%B8%B8%E7%94%A8%E5%B1%9E%E6%80%A7.png" alt="常用属性"></p><h4 id="_8-输入输出-动态列配置-优化" tabindex="-1">8.输入输出“动态列配置”优化 <a class="header-anchor" href="#_8-输入输出-动态列配置-优化" aria-label="Permalink to &quot;8.输入输出“动态列配置”优化&quot;">​</a></h4><p>在事件配置-设置输出中，会根据控件所在区域是否为表格显示隐藏“动态列配置”列</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%8A%A8%E6%80%81%E5%88%97%E9%85%8D%E7%BD%AE.png" alt="动态列配置"></p><h4 id="_9-ui配置画布优化" tabindex="-1">9.UI配置画布优化 <a class="header-anchor" href="#_9-ui配置画布优化" aria-label="Permalink to &quot;9.UI配置画布优化&quot;">​</a></h4><ul><li>1).选中控件标识：选中的控件有明显的样式标识（背景色，边框等），如下图：</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E9%80%89%E4%B8%AD%E6%8E%A7%E4%BB%B6.png" alt="选中控件"></p><ul><li>2).控件在容器中，每一层容器间有一定的间距，方便选中容器控件，如下图：</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%AE%B9%E5%99%A8%E6%8E%A7%E4%BB%B6%E9%97%B4%E8%B7%9D.png" alt="容器控件间距"></p><ul><li>3).表单配置与弹窗配置切换样式优化：修改成tab切换的模式，如下图：</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E8%A1%A8%E5%8D%95%E5%BC%B9%E7%AA%97%E5%88%87%E6%8D%A2.png" alt="表单弹窗切换"></p><ul><li>4).必填控件添加“*”样式标识：方便从表单中直观看出哪些控件设置了必填，如下图：</li></ul><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E5%BF%85%E5%A1%AB%E6%8E%A7%E4%BB%B6.png" alt="必填控件"></p><h4 id="_10-控件预览收起展开优化" tabindex="-1">10.控件预览收起展开优化 <a class="header-anchor" href="#_10-控件预览收起展开优化" aria-label="Permalink to &quot;10.控件预览收起展开优化&quot;">​</a></h4><p>控件预览收起展开时会记录用户习惯，如：当收起控件预览时，在新开的UI表单页面里控件预览默认收起。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/%E6%8E%A7%E4%BB%B6%E9%A2%84%E8%A7%88.png" alt="控件预览"></p>',67),o=[p];function n(h,r,c,s,d,E){return t(),l("div",null,o)}const m=a(i,[["render",n]]);export{B as __pageData,m as default};
